def unprotect_branch(project_id, branch_name):
    branch_encoded = urllib.parse.quote(branch_name, safe='')
    response = requests.delete(f"{API_URL}/projects/{project_id}/protected_branches/{branch_encoded}", auth=auth)
    if response.status_code == 204:
        print(f"Unprotected branch '{branch_name}' in project {project_id}")
        return True
    else:
        print(f"Failed to unprotect branch '{branch_name}' in project {project_id}: {response.status_code} {response.text}")
        return False
